import React from 'react';

import { useNavigate } from 'react-router-dom';

import backButton from '../img/backButton.svg'

import '../css/Result.css';

const Result = () => {

    // Redirect to loading page
    const navigate = useNavigate();

    const directHome = () => {
        navigate('/')
    }

    return (
        <div>
            {/* Title Section */}
            <div className="result-title">

                {/* Back button */}
                <div className="back-button-content">
                    <button className="back-button" onClick={directHome}>
                            <img src={backButton} className="back-button-icon"/>
                            <p className="back-title"><strong>Select another organization</strong></p>
                    </button>
                </div>

                {/* Titles */}
                <h1 className="heading-one mt-4"><strong>SeattleTeam</strong></h1>
                <p className="heading-small-title"><strong>5 USERS FOUND</strong></p>

                {/* Button to search a specific user */}
                <button className="search-for-user-button"><strong className="search-user-button-text">Search for a specific user</strong></button>

            </div>

            {/* The list of result */}
            <div className="result-content">
                <div className="result-card-title">

                </div>

                <div className="result-card-content">
                    <div className="result-card-item">
                        <p className="result-card-item-name">John Paul</p>
                        <p className="result-card-item-data">$500</p>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Result;
